import React from 'react';
import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
    },
    header: {
        fontWeight: 'bold',
        fontSize: 25,
        textAlign: 'center'
    },
    boxContainer: {
        borderRadius: 10,
        backgroundColor: 'lightgrey',
        marginTop: 50,
        padding: 45
    },
    textInput: {
        backgroundColor: 'white',
        marginVertical: 5,
    }
});

export default styles;
